import React, { Component } from 'react'

export default class Register extends Component {
    render() {
        return (
            <div id="Registerwrp">
                <Input className="int" placeholder="请输入学号" prefix={<UserOutlined />} />
                    <Input.Password className="int" prefix={<LockOutlined />} placeholder="请输入密码"/>
            </div>
        )
    }
}
